  `licenceKey` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `licenceDay` datetime DEFAULT NULL,
  `licenceExp` datetime DEFAULT NULL,
  `os` varchar(25) COLLATE utf8_bin DEFAULT NULL,
  `over10h` varchar(25) COLLATE utf8_bin DEFAULT NULL,
  `over4h` varchar(25) COLLATE utf8_bin DEFAULT NULL,
  `aggregation` varchar(15) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK990543C975CF5552` (`company`),
  CONSTRAINT `FK990543C975CF5552` FOREIGN KEY (`company`) REFERENCES `tbl_company` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

